import { useSelector } from 'react-redux';
import classes from './Header.module.css';

const Header = () => {

  const isAuthenticated = useSelector((state) => state.auth.isAuthenticated);


  return (
    <header className={classes.header}>
      <h1>Redux Auth</h1>

    </header>
  );
};

export default Header;
